import React from "react";

const Clients = () => {
  return (
    <div className=" flex flex-col max-w-[1099px] mh-[632.01px] bg-[#FFFFFF]">
      <div className="flex flex-row">
        <div className="flex ">
          <img
            src="/Group 8.png"
            alt="logo"
            width="42.79px"
            height="44px"
            className="content-center"
          />
          <div>Clients</div>
        </div>
      </div>
    </div>
  );
};

export default Clients;
